import React from 'react';
import Slider from 'react-slick';
import SliderImage from './SliderImage';

const MyImgSlider = () => {
    var settings = {
        className: "center",
        centerMode: true,
        infinite: true,
        dots: false,
        centerPadding: "60px",
        slidesToShow: 3,
        speed: 500,
        arrows: false,
        autoplay:true,
        responsive: [
          {
            breakpoint: 990,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 1,
              infinite: true,
              dots: false,
              centerMode: false,
            },
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
              centerMode: false,
            },
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
              centerMode: false,
            },
          },
        ],
      };
  return (
    <div>
      <Slider {...settings}>
        <SliderImage/>
        <SliderImage/>
        <SliderImage/>
        <SliderImage/>
      </Slider>
    </div>
  );
}

export default MyImgSlider;
